import React, { useEffect } from "react";
import * as API from "../../utils/api";
import DisplayTodo from "./DisplayTodo";

const Index = ({ todos }) => {
  useEffect(() => {
    API.getTodos()
      .then((response) => {
        console.log(response.data);
      })
      .catch(function (error) {
        console.log(error);
      })
      .finally(function () {});
  }, []);
  return (
    <>
      <table>
        <tr>
          <th>Id</th>
          <th>Title</th>
        </tr>
        <tr>
          {todos.map((todo) => (
            <DisplayTodo key={todo.id} todos={todos}></DisplayTodo>
          ))}
        </tr>
      </table>
    </>
  );
};

export default Index;
